  false,\n\t\"url\": null,\n\t\"notes\": \"A series of dives were conducted from 1998
  to 2003 through out the Hawaiian Archipelago using the Hawaii Undersea Research
  Laboratory's ROV RCV-150 and submersibles Pisces IV and Pisces V.  The dives were
  focused on surveying subphotic fish assemblages (300-500 m) in relation to patches
  of deep corals and relative to regional differences in oceanic productivity.\",\n\t\"license_title\":
